entries.desc:
type 'a type_search_result = {
  name : string;
  typ : 'a;
  loc : Location.t;
  doc : string option;
  cost : int;
  constructible : string;
}

value.type:
sig
  type 'desc raw_entry = {
    name : string;
    kind :
      [ `Constructor
      | `Keyword
      | `Label
      | `MethodCall
      | `Modtype
      | `Module
      | `Type
      | `Value
      | `Variant ];
    desc : 'desc;
    info : 'desc;
    deprecated : bool;
  }
  type entry = string raw_entry
  type application_context = {
    argument_type : string;
    labels : (string * string) list;
  }
  type t = {
    entries : entry list;
    context : [ `Application of application_context | `Unknown ];
  }
  type kind =
      [ `Constructor
      | `Keywords
      | `Labels
      | `Modules
      | `Modules_type
      | `Types
      | `Values
      | `Variants ]
end

sig
  type document = {
    kind : [ `Auto | `ML | `MLI ];
    path : string option;
    dot_merlins : string list option;
  }
  type t = {
    document : document option;
    printer_width : int option;
    printer_verbosity : string option;
  }
end

value:
(match merlin with
| { build_path; source_path; hidden_build_path; hidden_source_path; cmi_path;
    cmt_path; index_files; extensions; suffixes; stdlib; source_root;
    unit_name; wrapping_prefix; reader; protocol; log_file; log_sections;
    config_path; use_ppx_cache; exclude_query_dir; flags_to_apply;
    flags_applied; failures; extension_to_reader; cache_lifespan;
    use_typer_cache } -> _)

entries.desc:
type merlin =
  Mconfig.merlin = {
  build_path : string list;
  source_path : string list;
  hidden_build_path : string list;
  hidden_source_path : string list;
  cmi_path : string list;
  cmt_path : string list;
  index_files : string list;
  extensions : string list;
  suffixes : (string * string) list;
  stdlib : string option;
  source_root : string option;
  unit_name : string option;
  wrapping_prefix : string option;
  reader : string list;
  protocol : [ `Json | `Sexp ];
  log_file : string option;
  log_sections : string list;
  config_path : string option;
  use_ppx_cache : bool;
  exclude_query_dir : bool;
  flags_to_apply : string list Std.with_workdir list;
  flags_applied : string list Std.with_workdir list;
  failures : string list;
  extension_to_reader : (string * string) list;
  cache_lifespan : int;
  use_typer_cache : bool;
}

type ocaml =
  Mconfig.ocaml = {
  include_dirs : string list;
  hidden_dirs : string list;
  no_std_include : bool;
  unsafe : bool;
  classic : bool;
  principal : bool;
  real_paths : bool;
  threads : [ `None | `Threads | `Vmthreads ];
  recursive_types : bool;
  strict_sequence : bool;
  applicative_functors : bool;
  nopervasives : bool;
  strict_formats : bool;
  open_modules : string list;
  ppx : string Std.with_workdir list;
  pp : string Std.with_workdir option;
  warnings : Warnings.state;
}

type query =
  Mconfig.query = {
  filename : string;
  directory : string;
  printer_width : int;
  verbosity : Mconfig.Verbosity.t;
}

type t =
  Mconfig.t = {
  ocaml : Mconfig.ocaml;
  merlin : Mconfig.merlin;
  query : Mconfig.query;
}
